import React from 'react';

const DepartureSearchBox =(onChange)=>{
    return(
        <SearchField
            placeholder="Search..."
            onChange={onChange}
            searchText="This is initial search text"
            classNames="test-class"
        />
    );   
}
export default DepartureSearchBox;
